export const findAll = () =>{
    console.log()
    return fetch("http://localhost:3000/film/",{
        method: 'GET',
        headers: {
          Accept: 'application/json',
          'Content-Type': 'application/json'
        }
    })
    .then((data)=>{
        console.log(data);
        data.json();
    }).catch((err)=>
        console.log(err)
    )
}
